column8:
マジカルアートレザーはウレタン系合皮を使用している為、柔軟性に優れ曲面など細部までキレイに貼って頂けます。マジカルアートレザーは、特殊加工でカーボンの凸凹をリアルに再現しており高級感を存分に楽しんでいただけます。※本商品の使用用途は自動車の内装パーツ等、インテリア専用にてご使用下さい。※屋外での耐候性・防水性には適しておりませんのでエクステリアへのご使用はお控え下さい。※商品の厚さは約0.7mmとなります。 <br><br>■カラー:パールホワイト<br><br>対応車種：ANF10 HS250H <br><br>車検対応品<br><br>グッズ・アクセサリー/グッズアクセサリーその他<BR>※こちらの商品は代金引き換え不可となっております。ご了承ください。<tr><td colspan="2">
